const defaultState = {
    registration: {}
}

interface actionsTypes{
    state: any
}

export const registerReducer = (state=defaultState, action:actionTypes) => {
    switch (action.type) {
        case "ADD_Register":
            return {...state, 
                registration: action.payload}
        default: 
            return state
    }
}
